B.He=new A.kj("Drink plenty of water to be sure you are well hydrated. If you have a heart condition, kidney condition or any other health condition that prevents you from drinking large amounts of fluid, check with your healthcare practitioner for instructions on how to hydrate before your infusion procedure.","assets/images/bottle.png",null)
B.Hf=new A.kj("Wear comfortable loose fitting clothes. You will want to be comfortable, and most likely your vital signs will monitored (for example, blood pressure, heart rate, respiratory rate (breathing  rate), or a cardiac monitor may be attached to your chest). Every infusion center is different, so check with yours in regard to what to expect. Wearing loose fitting clothes allows the medical staff to easily and properly monitor your vital signs.","assets/images/comfortclothes.png",null)
B.Hg=new A.kj("Our infusion centers will provide blankets, pillows, water and coffee. Check to see what other items the center provides in case they do not offer something that will make you more comfortable.","assets/images/pillow.png",null)
B.Hh=new A.kj("Consider wearing clothing with layers to allow for temperature control. The temperature of the infusion center may be cool or warm; also some intravenous infusions can make you feel either warm or cool. Having layers of clothing allows you the flexibility too easily control your comfort zone.","assets/images/comfortclothes.png",null)
B.Hi=new A.kj("Some infusions may require that you pre-medicate with medications such as acetaminophen, (Tylenol). Check with the infusion staff regarding any pre-medications you need to take prior to your infusion, the dose, and the best time to take the medications.","assets/images/premedication.png",null)
